exports=async function(bid,options){const{parseCatalogPaginate,getSelectLastOption}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.ayouyou.com/booktxt/${bid}/${1===page?"":"?page="+page}`,".section-list",{...options,clientOptions,pageSize:100,totalPagesRegex:html=>getSelectLastOption(html,s=>-1!==s.indexOf("/?page="))?.subRegex(/page=(\d+)/)?.intValue()})};